function startBattleIntro(){
    this.isIntroFinished = true
    this.introT = this.game.time.events.add(500, function(){
        this.versusIcon.alpha = 1;
        this.uiLightning.alpha = 1;
        const { animations } = this.versusIcon.animationStateData.skeletonData;
        this.versusIcon.animationState.setAnimation(0, animations[0].name);
    })

    var isLandscape = this.game.height / this.game.width  < 1.3 ? true: false;

    if(!isLandscape){
        game.add.tween(this.bgRobot).to({ y:this.game.height*0.15 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.boardRobot).to({ y:this.game.height*0.25 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.bgPlayer).to({ y:this.game.height*0.65 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.boardPlayer).to({ y:this.game.height*0.75 },500,Phaser.Easing.Sinusoidal.In,true);

        game.add.tween(this.playerBg).to({ x:this.game.width*0.15 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.playerAvatar).to({ x:this.game.width*0.2 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.namePlayer).to({ x:this.game.width*0.2 },500,Phaser.Easing.Sinusoidal.In,true);

        game.add.tween(this.robotBg).to({ x:this.game.width*0.85 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.robotAvatar).to({ x:this.game.width*0.8 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.nameRobot).to({ x:this.game.width*0.8 },500,Phaser.Easing.Sinusoidal.In,true);
    }else{
        game.add.tween(this.bgRobot).to({ x:this.game.width*0.25 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.boardRobot).to({ x:this.game.width*0.25 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.bgPlayer).to({ x: this.game.width*0.75},500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.boardPlayer).to({ x: this.game.width*0.75},500,Phaser.Easing.Sinusoidal.In,true);

        game.add.tween(this.playerBg).to({ x:this.game.width*0.3 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.playerAvatar).to({ x:this.game.width*0.3 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.namePlayer).to({ x:this.game.width*0.15 },500,Phaser.Easing.Sinusoidal.In,true);

        game.add.tween(this.robotBg).to({ x:this.game.width*0.8 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.robotAvatar).to({ x:this.game.width*0.7 },500,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.nameRobot).to({ x:this.game.width*0.85 },500,Phaser.Easing.Sinusoidal.In,true);
    }
    this.introT.timer.onComplete.add(this.finishedBattleIntro)
}

function finishedBattleIntro(){
     this.introT.timer.removeAll()
     this.outroT = this.game.time.events.add(1500, function(){
        game.add.tween(this.versusIcon).to({ alpha: 0 },250,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.darkLight).to({ alpha: 0 },250,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.playerBg).to({ alpha: 0 },250,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.robotBg).to({ alpha: 0 },250,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.robotAvatar).to({ alpha: 0 },250,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.playerAvatar).to({ alpha: 0 },250,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.uiLightning).to({ alpha: 0 },250,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.namePlayer).to({ alpha: 0 },250,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.nameRobot).to({ alpha: 0 },250,Phaser.Easing.Sinusoidal.In,true);
        game.add.tween(this.dishesGroup).to({ alpha: 1 },250,Phaser.Easing.Sinusoidal.In,true);
    })
    this.outroT.timer.onComplete.add(this.showUI)
}

